import { Button } from "@mantine/core";
import React from "react";

function Modal({children,open,isClose}){
    
    if(!open) return null;
    
    return(
        <div style={{backgroundColor:"gray"}}>
            <h1>{children}</h1>
            <Button onClick={()=>{isClose()}}>Close Modal</Button>
        </div>
    )
}

export default Modal;
